  let subjectCascadeDatas = []
  for(var subjectKey in subjectData) {
    var subjectId = subjectKey.split("|")[0];
    var subjectName = subjectKey.split("|")[1];

    let subjectCascadeData = {
      value: subjectId,
      label: subjectName,
      children: []
    }
    var domainData = subjectData[subjectKey]
    for(var domainKey in domainData) {
      var domainId = domainKey.split("|")[0];
      var domainName = domainKey.split("|")[1];

      var option = {
        value: domainId,
        label: domainName,
        children: domainData[domainKey]
      };
      subjectCascadeData.children.push(option);

    }

    subjectCascadeDatas.push(subjectCascadeData);
  }

  return subjectCascadeDatas;
}
